            typeSpeed={70}
            deleteSpeed={50}
            delaySpeed={1000}
            // onLoopDone={handleDone}
            // onType={handleType}
          />
        </h2>
      </div>
      <div className="home-right-div">
      {/* <ul className="tech-stack">
            {stacks.map((stack) => (
              <Stack stack={stack} />
            ))}
          </ul> */}
        <img className="mage" src={mage} />
        <img className="mage2" src={mage2} />
      </div>
    </div>
  );
};
export default Home;
